description:
The 1995 movie Kicking and Screaming (NOT the 2005 soccer one with Will Farrell). Follows a handful of college students post-graduation and their identity crises that follow.

Fun fact from IMDB: \&quot;The film was almost accepted in competition at the Cannes Film Festival, but Noah Baumbach refused to cut fifteen minutes as they requested, and the film was ultimately rejected.\&quot;

Enjoy!
